import React from 'react'

export default function HomeCOntent() {
    return (
        <>
        <div style={{width: '100%', height: '100vh',backgroundImage:"linear-gradient(to bottom, #cdba6d, #fbbe9c, #ffcfd2, #fde8f6, #ffffff)",display:"grid",placeItems:"center"}}>
        <div style={{width:"400px",height:"450px",backgroundColor:"white",boxShadow:"2px 2px 2px 2px grey",marginTop:"30px",borderRadius:"10px"}}>
        <h1 style={{textAlign:"center",marginTop:"10px",textShadow:"1px 1px grey"}}>Aggriments</h1>

        <input type="text" placeholder=""></input>
             
        </div>
        </div>
        </>
    )

}
